import React from "react"; 
import {Btn, Container,HeadTitle} from './style'

class Buttons extends React.Component{
      render(){
        return(
            <Container>
                
            <HeadTitle>Login</HeadTitle>
             <HeadTitle>Register</HeadTitle>           

               <Btn>Login</Btn>
               <Btn>Register</Btn>

            </Container>
        )
      }
}
export default Buttons
